import React from 'react';
import NavBar from '../components/NavBar';

function LandingPage()
{
    return (
        <div id="LandingPageDiv">
            <div id="NavBar">
                <NavBar />
            </div>
            <h1 id="user-authetication-title">Sign Up</h1>
        </div>
    );
}

export default LandingPage;
